[[div style="center no-repeat ; float: center; border: 3px solid #704d34; padding: 1px 15px; margin: 10px 10px 10px 10px;background-color: #ebbb98"]]
**GILGAMESH**, Slayer of the Bull of Heaven, slayer of Humbaba, slayer of lions, the first hero, Mightiest Son, the god-man, ð’€­ð’„‘ð’‚†ð’ˆ¦, has died. He has gone to the low place, that House of Dust, the hell beneath the earth known to mortals as **IRKALLA**. It is in this place that the king of kings plans to save his people.

**NERGAL**, the jackal-god, the Lord of the Poplars, Lord of the Sunset, God of Pestilence, War, and Famine. He has toppled **ERESHKIGAL** from her throne, and now rules the House of Dust with his red-hand. He despoils the fallow land of the dead, and leaves not a son to his mother nor a wife to her husband. He is a wicked king, an evil king, and all of **IRKALLA** weeps until he is defeated.

**HEAVY ENGAGEMENT CHASSIS**, armor of the gods, forged by the Nations United, gifted through the machinations of the Furthest West. Manufactured: 1978. First deployed: 1980. Weight: 1,350 pounds. Maximum torque: 12,200 ft-lbs. PHYSICS motto: PEACE THROUGH FORCE. It is through its mailed fist that **GILGAMESH** may free his people, and it is through its hydraulic actuators that **NERGAL** may be brought low. 

